import React from "react";
import { Route, Switch } from "react-router-dom";
import Navbar from "../navbar/Navbar.js";
import Home from "./homepage/Home.js";

function App () {
    return(
        <div>
            <Navbar/>
            <Switch>
                <Route path="/" component={Home}/>
            </Switch>
        </div>
    )
}

export default App;
